import React, { Component } from 'react';
import './Calculator.css';

class CalcButton extends Component {

    render() {
        return (
            <div className="calc-button" onClick={() => this.props.clickHandler(this.props.text)}>
                <div>{this.props.text}</div>
            </div>
        )
    }
}

class Calculator extends Component {
  constructor(props){
    super(props);
    this.state = {
      result: ""
    };
  }

  clear() {
    this.setState({ result: "" });
  }

  buttonHandler(val) {

    let res = "";
    if (val === "=") {
      try {
        res = eval(this.state.result);
      } catch(e) {
        res = "Error";
      }
    } else {
      if (this.state.result.length >= 12) {
        return;
      }
      res = this.state.result + val;
    }
    this.setState({ result: res });
  }

  render() {
    return (
      <div className="Calculator">
        <div className="result-panel">
          <div className="result-text">{this.state.result}</div>
        </div>
        <div className="calc-container">
          <table>
          <tbody>
            <tr>
              <td className="clear-btn" colSpan="4" onClick={() => this.clear()}>Clear</td>
            </tr>
            <tr>
              <td className="calc-num"><CalcButton text={7} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-num"><CalcButton text={8} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-num"><CalcButton text={9} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-op"><CalcButton text={'/'} clickHandler={(v) => this.buttonHandler(v)}/></td>
            </tr>
            <tr>
              <td className="calc-num"><CalcButton text={4} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-num"><CalcButton text={5} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-num"><CalcButton text={6} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-op"><CalcButton text={'*'} clickHandler={(v) => this.buttonHandler(v)}/></td>
            </tr>
            <tr>
              <td className="calc-num"><CalcButton text={1} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-num"><CalcButton text={2} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-num"><CalcButton text={3} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-op"><CalcButton text={'-'} clickHandler={(v) => this.buttonHandler(v)}/></td>
            </tr>
            <tr>
              <td className="calc-num"><CalcButton text={0} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-num"><CalcButton text={'.'} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-op"><CalcButton text={'='} clickHandler={(v) => this.buttonHandler(v)}/></td>
              <td className="calc-op"><CalcButton text={'+'} clickHandler={(v) => this.buttonHandler(v)}/></td>
            </tr>
          </tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default Calculator;
